def solution(stdin: str) -> str:
    n = int(input().strip())
    edges = []
    for i in range(n-1):
        a, b = map(int, input().strip().split())
        edges.append((a, b))
        edges.append((b, a))

    def dfs(node, visited, path, simple_paths):
        visited[node] = True
        path.append(node)

        for neighbor in edges:
            if not visited[neighbor[1]]:
                dfs(neighbor[1], visited, path, simple_paths)

        simple_paths.append(path[:])
        path.pop()

    max_edges = 0
    res_vertices = None

    for i in range(1, n+1):
        visited = [False] * (n+1)
        path = []
        simple_paths = []

        dfs(i, visited, path, simple_paths)

        for path in simple_paths:
            path_edges = set()
            for j in range(len(path)-1):
                path_edges.add((min(path[j], path[j+1]), max(path[j], path[j+1])))
            max_edges = max(max_edges, len(path_edges))

            if max_edges == len(path_edges):
                res_vertices = path

    return f"{max_edges}\n{' '.join(map(str, res_vertices))}"

