    n, d, k = map(int, stdin.split())

    # Check if there is a tree with the given conditions
    if n == 1:
        return "YES\n1 1"
    if d == 1:
        return "YES\n" + "\n".join([f"{i} {i+1}" for i in range(n-1)])

    # Create a tree with the given conditions
    graph = {i: [] for i in range(1, n+1)}
    for i in range(1, n):
        for j in range(i+1, n+1):
            graph[i].append(j)
            graph[j].append(i)

    # Add edges to the tree
    for i in range(1, n+1):
        while len(graph[i]) < k:
            for j in range(i+1, n+1):
                if len(graph[i]) < k and j not in graph[i]:
                    graph[i].append(j)
                    graph[j].append(i)

    # Check if the tree diameter is at most d
    visited = {1}
    queue = [1]
    max_distance = 0

    while queue:
        node = queue.pop(0)
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append(neighbor)
                max_distance = max(max_distance, len(queue))

    if max_distance > d:
        return "NO"

    # Print the edges of the tree
    result = ["YES"]
