        for i in range(1, len(nums)):
            if nums[i] < prev:
                return False
            prev = nums[i]
        return True

    def monotonic_renum(nums):
        if is_monotonic(nums):
            return [0] * n

        count = [0] * (n + 1)
        for num in nums:
