                index += 1
                count[i] -= 1

        return b[:-1]

    def count_monotonic_renum(nums):
        if len(nums) == 1:
            return 1

        count = 0
        for i in range(1, len(nums)):
            if nums[i] == nums[0]:
                count += count_monotonic_renum(nums[i:])

        return count

    b = monotonic_renum(a)
