def solution(stdin: str) -> str:
    n = int(stdin.split()[0])
    a = list(map(int, stdin.split()[1:n+1]))
    b = list(map(int, stdin.split()[n+1:2*n+1]))

    # Sort b in increasing order
    b.sort()

    # Calculate c
    c = [(a[i] + b[i]) % n for i in range(n)]

    # Check if c is in lexicographically minimum order
    is_min = True
    for i in range(1, n):
        if c[i] < c[i-1] or (c[i] == c[i-1] and b[i] < b[i-1]):
            is_min = False
            break

    # If not, swap b[i] and b[j] to minimize c
    if not is_min:
        for i in range(n-1):
            for j in range(i+1, n):
                if (c[i] > c[j]) or (c[i] == c[j] and b[i] > b[j]):
                    b[i], b[j] = b[j], b[i]
                    c = [(a[i] + b[i]) % n for i in range(n)]

                    if all(c[i] <= c[i+1] for i in range(n-1)):
                        break

    # Print c
    return ' '.join(map(str, c))

