        for i in range(n):
            if parent[i] == -1:
                bfs(graph, i + 1, [False] * n, parent)
        tree = [[] for _ in range(n)]
        for i in range(n):
            if parent[i] != -1:
                tree[parent[i] - 1].append(i + 1)
        return tree

    def diameter(tree, n):
        diameter = 0
        for i in range(n):
            visited = [False] * n
            dfs(tree, i + 1, visited, -1)
            for j in range(n):
                if not visited[j]:
                    current_diameter = dfs(tree, j + 1, [False] * n, -1)
                    diameter = max(diameter, current_diameter)
        return diameter

