            edges.append([u, v, w])
        return n, m, edges

    def find_mst_cost(n: int, m: int, edges: List[List[int]]) -> int:
        adjacency_matrix = [[0] * n for _ in range(n)]
        for u, v, w in edges:
            adjacency_matrix[u - 1][v - 1] = w
            adjacency_matrix[v - 1][u - 1] = w

        visited = [False] * n
        visited[0] = True
        min_cost = 0
        min_cost_edges = []

        while not all(visited):
            min_edge_cost = float('inf')
            min_edge = None
            for i in range(n):
                if not visited[i]:
                    for j in range(n):
                        if adjacency_matrix[i][j] > 0 and not visited[j]:
                            if adjacency_matrix[i][j] < min_edge_cost:
                                min_edge_cost = adjacency_matrix[i][j]
                                min_edge = (i, j)
            min_cost += min_edge_cost
            min_cost_edges.append(min_edge)
            visited[min_edge[1]] = True

        return min_cost, min_cost_edges

    def unify_mst(n: int, m: int, edges: List[List[int]], cost: int) -> int:
        min_operations = 0
        mst_cost, mst_edges = find_mst_cost(n, m, edges)

        if mst_cost != cost:
            return -1  # MST cost is different from the given cost

        for edge in mst_edges:
            u, v = edge
            for i in range(m):
                if edges[i] == [u + 1, v + 1] or edges[i] == [v + 1, u + 1]:
                    break
            else:
                min_operations += 1

        return min_operations

    n, m, edges = read_input()
    k = int(input())
    return str(unify_mst(n, m, edges, k))

