        adj_matrix = [[0] * n for _ in range(n)]
        for v, u in edges:
            adj_matrix[v - 1][u - 1] = 1
            adj_matrix[u - 1][v - 1] = 1

        visited = [False] * n
        max_degree_vertex = None
        max_degree = 0
        for i in range(n):
            if not visited[i]:
                stack = [i]
                degree = 0
                while stack:
                    v = stack.pop()
                    if not visited[v]:
                        visited[v] = True
                        degree += 1
                        for u in range(n):
                            if adj_matrix[v][u] and not visited[u]:
                                stack.append(u)
                if degree > max_degree:
                    max_degree = degree
                    max_degree_vertex = i

        spanning_tree = []
        visited = [False] * n
        stack = [max_degree_vertex]
        while stack:
            v = stack.pop()
            if not visited[v]:
                visited[v] = True
                for u in range(n):
                    if adj_matrix[v][u] and not visited[u]:
                        stack.append(u)
                        spanning_tree.append((v, u))

        return spanning_tree

    n, m, edges = read_input()
