def solution(stdin: str) -> str:
    # read input
    matrix = []
    for i in range(4):
        matrix.append([int(x) for x in input().split()])
    direction = int(input())

    # perform movement
    def move_left(matrix):
        changed = False
        for i in range(4):
            j = 0
            while j < 4:
                if matrix[i][j] == 0:
                    matrix[i][j], matrix[i][j + 1] = matrix[i][j + 1], matrix[i][j]
                    changed = True
                    j += 1
                elif j < 3 and matrix[i][j] == matrix[i][j + 1] and matrix[i][j] != 0:
                    matrix[i][j] *= 2
                    matrix[i][j + 1] = 0
                    changed = True
                j += 1
        return changed

    def move_up(matrix):
        changed = False
        for j in range(4):
            i = 0
            while i < 4:
                if matrix[i][j] == 0:
                    matrix[i][j], matrix[i + 1][j] = matrix[i + 1][j], matrix[i][j]
                    changed = True
                    i += 1
                elif i < 3 and matrix[i][j] == matrix[i + 1][j] and matrix[i][j] != 0:
                    matrix[i][j] *= 2
                    matrix[i + 1][j] = 0
                    changed = True
                i += 1
        return changed

    def move_right(matrix):
        changed = False
        for i in range(4):
            j = 3
            while j >= 0:
                if matrix[i][j] == 0:
                    matrix[i][j], matrix[i][j - 1] = matrix[i][j - 1], matrix[i][j]
                    changed = True
                    j -= 1
                elif j > 0 and matrix[i][j] == matrix[i][j - 1] and matrix[i][j] != 0:
                    matrix[i][j] *= 2
                    matrix[i][j - 1] = 0
                    changed = True
                j -= 1
        return changed

    def move_down(matrix):
        changed = False
        for j in range(4):
            i = 3
            while i >= 0:
                if matrix[i][j] == 0:
                    matrix[i][j], matrix[i - 1][j] = matrix[i - 1][j], matrix[i][j]
                    changed = True
                    i -= 1
                elif i > 0 and matrix[i][j] == matrix[i - 1][j] and matrix[i][j] != 0:
                    matrix[i][j] *= 2
                    matrix[i - 1][j] = 0
                    changed = True
                i -= 1
        return changed

    while True:
        if direction == 0:
            if not move_left(matrix):
                break
        elif direction == 1:
            if not move_up(matrix):
                break
        elif direction == 2:
            if not move_right(matrix):
                break
        else:
            if not move_down(matrix):
                break

    # output result
    for row in matrix:
        print(" ".join(map(str, row)))

