        num_accepted = 0
        for problem_id in solution:
            total_time += estimates[problem_id]
            num_accepted += 1
            if total_time > 300:
                return False
        return num_accepted == 2 and total_time <= 300

    def min_penalty_time(problem_id: int, remaining_problems: List[int], start_time: int) -> int:
        if not remaining_problems:
            return start_time
        min_penalty = float('inf')
        for i in range(len(remaining_problems)):
            next_problem_id = remaining_problems[i]
            new_problems = remaining_problems[:i] + remaining_problems[i+1:]
            penalty = min_penalty_time(next_problem_id, new_problems, start_time + estimates[next_problem_id])
            min_penalty = min(min_penalty, penalty)
        return min_penalty

    if p == 0:
        solution = [p, (p + 1) % n]
        if check_solution(solution):
            return f"2 {min_penalty_time(p, [i for i in range(n) if i != p], estimates[p])}"
        else:
            return f"0 0"
    else:
        solution = [p, (p - 1) % n]
        if check_solution(solution):
            return f"2 {min_penalty_time(p, [i for i in range(n) if i != p], estimates[p])}"
        else:
            return f"0 0"

