    def transposition(melody: str) -> str:
        notes = melody.split()
        transposed = [get_note_from_index((get_note_index(note) + 12) % 12) for note in notes]
        return ' '.join(transposed)

    def inversion(melody: str, first_note: str) -> str:
        notes = melody.split()
        inverted = [get_note_from_index((get_note_index(first_note) - get_note_index(note)) % 12) for note in notes]
