def solution(stdin: str) -> str:
    """
    Solves the problem of ants moving in rows.

    Args:
        stdin: The input string.

    Returns:
        The output string with the order of the ants after T seconds.
    """
    # Get input
    first_row, second_row, time = stdin.split("\n")
    time = int(time)

    # Get the positions of the ants in the first row
    first_row_positions = {}
    for index, ant in enumerate(first_row):
        first_row_positions[ant] = index

    # Get the positions of the ants in the second row
    second_row_positions = {}
    for index, ant in enumerate(second_row):
        second_row_positions[ant] = index

    # Get the initial positions of the ants
    ants_positions = {}
    for ant in first_row:
        ants_positions[ant] = first_row_positions[ant]
    for ant in second_row:
        ants_positions[ant] = second_row_positions[ant]

    # Simulate the movement of the ants
    for _ in range(time):
        for ant, position in list(ants_positions.items()):
            # Get the position of the ant in front
            next_position = position - 1 if position > 0 else len(first_row) - 1
            ant_in_front = first_row[next_position] if position < len(first_row) else second_row[next_position]

            # Check if the ant in front is moving in the opposite direction
            if ants_positions[ant_in_front] > position:
                # Swap the positions of the two ants
                ants_positions[ant] = next_position
                ants_positions[ant_in_front] = position

    # Get the final order of the ants
    result = [ant for ant, position in sorted(ants_positions.items(), key=lambda x: x[1])]

    return "".join(result)

