def solution(stdin: str) -> str:
    triangles = []
    lines = stdin.split('\n')
    n = int(lines[0])
    for i in range(1, n+1):
        A, B, C = map(float, lines[i].split())
        triangles.append((A, B, C))

    def find_max_distance(triangle):
        A, B, C = triangle
        sides = sorted([A, B, C])
        cos_a = (sides[0] ** 2 + sides[1] ** 2 - sides[2] ** 2) / (2 * sides[0] * sides[1])
        cos_b = (sides[0] ** 2 + sides[2] ** 2 - sides[1] ** 2) / (2 * sides[0] * sides[2])
        cos_c = (sides[1] ** 2 + sides[2] ** 2 - sides[0] ** 2) / (2 * sides[1] * sides[2])
        return max(sides[0] * cos_a, sides[1] * cos_b, sides[2] * cos_c)

    max_distance = max(map(find_max_distance, triangles))
    return round(max_distance, 4)

