    def is_valid_position(board, r, c) -> bool:
        return 1 <= r <= len(board) and 1 <= c <= len(board[0]) and board[r - 1][c - 1] != "#"

    def next_position(r, c) -> List[Tuple[int, int]]:
        return [(r + 2, c + 1), (r + 2, c - 1), (r - 2, c + 1), (r - 2, c - 1), (r + 1, c + 2), (r + 1, c - 2), (r - 1, c + 2), (r - 1, c - 2)]

    def bfs(board, start, end) -> int:
        queue = [(start, 0)]
        visited = set()

        while queue:
            current_pos, current_steps = queue.pop(0)

            if current_pos == end:
                return current_steps

            visited.add(current_pos)

            for next_pos in next_position(*current_pos):
                if is_valid_position(board, *next_pos) and next_pos not in visited:
                    queue.append((next_pos, current_steps + 1))

        return -1

    lines = stdin.splitlines()
    n = int(lines[0])
    board = lines[1:]
    start = (n, n)
    end = (1, 1)

    if is_valid_position(board, *end):
        return str(bfs(board, start, end))
    else:
        return "-1"

