    lines = stdin.splitlines()
    n = int(lines[0])
    num_students = [int(num) for num in lines[1].split()]

    # initialize variables
    pile = []
    visited = [False] * n
    safe_order = []

    # function to check if a room can be visited safely
    def can_visit(room_index: int) -> bool:
        if visited[room_index]:
            return False
        if len(pile) < num_students[room_index]:
            return False
        return True

    # function to redistribute exams in a room
    def redistribute_exams(room_index: int):
        nonlocal pile
        nonlocal visited
        nonlocal safe_order

        if not can_visit(room_index):
            return

        visited[room_index] = True
        room_exams = []
        for _ in range(num_students[room_index]):
            room_exams.append(pile.pop())

        for i, exam in enumerate(room_exams):
            pile.insert(i, exam)

    # loop through rooms and redistribute exams
    for room_index in range(n):
        if not visited[room_index]:
            redistribute_exams(room_index)

    # if there are exams left in the pile, add them to the first room
    if pile:
        redistribute_exams(0)

    # if all rooms have been visited, we have a safe order
    if all(visited):
        safe_order = [i+1 for i, v in enumerate(visited) if v]
    else:
        safe_order = "impossible"

    return safe_order

def solution(stdin: str) -> str:
    encrypted_message, key = stdin.split('\n')
    decrypted_message = ''
    for i in range(len(encrypted_message)):
        shift = ord(key[i]) - ord('A')
        if i % 2 == 1:
            shift = -shift
        decrypted_message += chr(((ord(encrypted_message[i]) - ord('A') - shift) % 26) + ord('A'))
    return decrypted_message

def solution(stdin: str) -> str:
    A, B, C, D = map(int, stdin.split())
    area = min(A, B) * min(C, D)
    return str(area)

def solution(stdin: str) -> str:
    a, b = map(int, stdin.split())
    count = 0

    while a != b:
        if a < b:
            count += 1
            a *= 2
        else:
            count += 1
            a -= 1

    return str(count)
